INSERT INTO `webboard` (`webboard_id`, `webboard_title`, `webboard_content`, `webboard_post`, `webboard_read`, `webboard_date`) VALUES
(18, 'ยืนยันเห็นผลจริง', 'เปลี่ยนเบอร์โทรศัพท์กับคุณพรพิฆเณศว์ไป ได้ผลลัพธ์ดีขึ้นจริง แต่ค่อยเป็นค่อยไปน่ะ แต่ขอยืนยันว่าดีจริง เมื่อก่อนเก็บเงินไม่อยู่ วางแผนแล้ววางอีก แต่ปัจจุบันดีขึ้น เบอร์ที่ใช้ปัจจุบัน 084-649-909X (ขอล่ะไว้หน่อยน่ะ)', 'แม่น้องบอมบ์', 3614, '2011-09-04 11:08:40'),
(25, 'ขอบคุณที่แนะนำครับ ชีวิตเปลี่ยนไปจริงๆ', 'ผมขอขอบคุณที่ช่วยแนะนำเรื่องเบอร์ มันเห็นผลลจริง และไวมาก แถมยังทำให้มีสิ่งดีๆเกิดขึ้นมากมาย ^^', 'หมวดชายแดน', 4660, '2012-06-23 13:47:17'),
(31, 'ขอขอบพระคุณ ในการให้บริการอย่างฉับไว ', 'ผมเปิดเจอเว็บไซด์นี้ตอนเช้าและลองเข้ามาศึกษา และลองส่ง Email เพื่อสอบถาม ... ปรากฏว่าเจ้าของเว็บไซด์ คุณ พรพิฆเณศว์  คงสมศักดิ์ ได้โทรกลับมาไม่เกิน ครึ่งชั่วโมง พร้อมคำปรึกษาที่ชัดเจน แม่นยำ ... บริการดีๆ แบบนี้ อยากให้ทุกท่านได้รับรู้ครับ ขอบพระคุณอีกครั้งครับ', 'โบว์ลิ่ง', 3961, '2012-10-17 09:25:41'),
(34, 'รบกวนสอบถามค่ะ', 'รบกวนช่วยดูเสองบอร์นี้ให้หน่อยค่ะ\r\n088 883 3866 --เบอร์หลัก\r\n084 655 6939 \r\n\r\nในกรณีที่ใช้ทั้ง2เบอร์ จะขัดกันมั้ยคะ ตอนนี้ทำงานราชการค่ะ \r\nแอบแปลกใจว่าตั้งแต่ได้เบอร์ที่สองมา แทบไม่มีคนโทรเข้าเบอร์แรกเลย \r\nตอนนี้กำลังมีแพลนจะย้ายงาน+\r\nเรียนต่อค่ะ จะเหมาะมั้ยคะ ขอบคุณล่วงหน้านะคะ', 'กวิศรา', 2411, '2012-10-22 15:29:52'),
(35, 'รบกวนช่วยดูให้หน่อยนะคะ', 'อยากจะถามว่า พ่อใช้เบอร์ 084-5599355 ดีัมั้ยคะ เค้าเพิ่งเปลี่ยนมาได้ไม่นานคะ ', 'ชนาธินาถ', 2106, '2012-10-24 19:25:07'),
(37, 'รบกวนช่วยดูเบอร์ให้หน่อยคร้าบ', 'คือว่าตอนนี้ใช้อยู่ 2 เบอร์อ่ะคร้าบ คือ\r\n081-4970715 กับ 0826536559 คร้าบ ช่วยดูให้หน่อยนะคร้าบ ว่าเป็นอย่างไง และถ้าจะใช้เบอร์เดียว เบอร์ไหนดีครับ ช่วยอธิบายละเอียดๆหน่อยนะคร้าบ ', 'นพ', 2304, '2012-10-29 15:28:29'),
(38, 'ดูเบอร์ให้หน่อยคร้าบ', 'รบกวนดูเบอร์ 0826454953 \r\nให้หน่อยคร้าบ ว่าจะเหมาะไหมคร้าบ เผอิญแฟนเปิด ร้านอาหาร กับ ร้านเบอเกอรรี คร้าบ จะเปลี่ยนให้แฟน', 'นพ', 2124, '2012-10-31 15:10:24'),
(41, 'รบกวนช่วยดูเบอร์ให้หน่อยคร้าบ', 'เผอิญได้เบอร์ 0814456459 มา ไม่ทราบว่ามีความหมายทางด้านไหนคร้าบ จะเก็บไว้ให้ลูก พี่คิดว่ามันจะเหมาะสมหรือป่าวคร้าบ', 'นพ', 2105, '2012-11-24 10:30:52'),
(42, 'ระหว่างผลรวมดีและความหมายดี อย่างไหนส่งผลมากกว่าคับ', 'ผมได้เบอร์คู่มาใช้กับแฟน คือ เบอร์ 091-409-9449 และ 091-409-9559 แต่ที่ดูความหมายจากเว็บคุณพี่มีความหมายดี แต่ถ้านับผลรวมมีผลลัพท์ไม่ดีอยู่1เบอร์ เลยอยากทราบว่า อย่างไหนส่งผลดีมากกว่ากันคับ ขอบคุณคับ\r\n\r\n', 'ฝากด้วยคับ', 2681, '2012-11-25 22:14:21'),
(43, 'วิเคราะห์ตามหลักโหราเลขศาสตร์ รวมค่าตัวเลข', 'สวัสดีครับ \r\n\r\nตอนนี้ผมกำลังสนใจเรื่องเบอร์โทรศัพท์ ซึุ่งจากการศึกษาผ่านทาง กูกเกิ้ล และ สื่ออื่นๆ ผมจะเห็นเว็บส่วนมาก (เช่น mahamodo เป็นตัวอย่าง) ใช่หลัก รวมค่าตัวเลข ซึ่ง ผมไม่แน่ใจว่า ของทางเมจิคเชียน ใช่ศาสตร์นี้เช่นกันหรือไม่  ที่ผมทางนี้เพราะว่าเบอร์โทรศัพท์ที่ดีและผมสนใจในเว็บนี้ บางครั้งก็รวมเลขออกมาไม่ดีเท่าไร ก็เลยสงสยว่าเราควรจะมีหลักการเข้าใจของศาสตร์นี่อย่างไร\r\n\r\nขอบคุณมากกครับสำหรับคำตอบ', 'แดน', 23098, '2012-11-29 10:01:54'),
(44, 'รบกวนสอบถามเบอร์หน่อยคร้าบ', 'รบกวนดูเบอร์หน่อยคร้าบ จะหาไว้ให้ลูกสาว เบอร์นี้ช่วยส่งเสริมเรื่องการเรียนไหม กับให้ลูกสาวดูเหมือนเป็นผู้หญิงหน่อยคร้าบ เบอร์ 0865449265 กับ เบอร์ 0841654692', 'นพ', 2447, '2012-11-29 16:26:50'),
(45, 'รบกวนสอบถามเบอร์อีกแล้วคร้าบ', 'คือว่าตอนนี้ใช้ เบอร์ 0826536559 อยู่ แล้วบังเอิญเพื่อนเอาเบอร์ 0889747899 มาให้ เลยอยากรู้ว่าถ้าจะใช้ทั้งสองเบอร์เลย จะดีไหม รบกวนแนะนำหน่อยคร้าบ', 'นพ', 2244, '2012-12-12 15:22:15'),
(46, 'ช่วยดูเบอร์ให้หน่อยนะคะ', 'สวัสดีค่ะ\r\nพอดีได้เบอร์นี้มาใช้ได้ประมาณ สองเดือนช่วยดูให้หน่อยได้ไหมค่ะว่าดีหรือเปล่า 081-0978046 เป็นคนเกิดวันพฤหัส และทำงานด้านการขายประกัน และเปิดร้านขายของชำ ด้วย ขอบคุณค่ะ\r\n', 'ฝน', 2158, '2012-12-12 23:05:17'),
(49, 'ช่วยตรวจเบอร์และอยากร่วมทำบุญกับพี่ครับ', 'สวัสดีครับพี่คือผมจะขอความกรุณาพี่ให้ตรวจเบอร์ของผมที่ใช้อยู่ว่าจะใช้เบอร์อะไรดีบ้างผมเป็นนายหน้าขายที่ดินครับอยู่ต่างจังหวัดผมมีหลายเบอร์ครับเบอร์ที่ใช้ประจำดังนี้ครับ\r\n1.087-9915444 จดทะเบียน\r\n2.084-4492965\r\n3.087-9554499\r\n4.089-9609092\r\n5.084-9599897\r\n6.086-2544255\r\n7.089-2416691\r\n8.081-4454495 ลงทะเบียนใช้\r\n9.081-4464944\r\n10.084-9624465\r\nปกติผมจะพก4เบอร์แรกครับผมจะพกเพิ่มอีก2เบอร์คือ084-9624465กับ084-9599897จะดีหรือเปล่าครับหรือจะช่วยตรวจสอบให้ผมก็ได้ครับส่วนเบอร์ที่เหลือผมคิดว่าผมอยากทำบุญร่วมกับพี่ครับโดยวิธ๊ใหนก็ได้ผมจะได้หายอึดอัดเสียทีหรือพี่มีความคิดยังงัยช่วยตอบให้ผมโทรหาพี่ก็ได้ครับ นับถือพี่มาก\r\n', 'พีรพจน์', 2505, '2013-01-02 21:33:02'),
(50, 'รบกวนดูเบอร์ให้หน่อยนะคับ', 'มีเบอร์อยู่ 2 เบอร์ คือ 083-599-5566 และ 083-566-9955 อยากทราบว่ามีผลต่างกันอย่างไรหรือเปล่าคับ หรือเลขไหนดีกว่าแบบชัดเจนคับ ผมจะใช้ไปทำงานไฟแนนซ์ที่ต่างประเทศคับ ขอบพระคุณ และ สวัสดีปีใหม่คับ', 'ผู้ไม่รู้', 2534, '2013-01-14 01:09:45'),
(56, 'การเปลี่ยนเบอร์ใหม่', 'เมื่อเราได้เบอร์ที่ถูกตาต้องใจชอบแล้วและก็เป็นเบอร์ที่ดีตามโฉลกของเราแล้ว ไม่ทราบว่าเมื่อได้ซิมมาแล้วจำเป็นจะต้องมีฤกษ์เปิดเบอร์ไหมครับ.เปิดเบอร์ใหม่ใช้ได้เลยไหมในวันนั้นๆ ', 'สมศักดิ์', 10520, '2013-03-02 16:26:10'),
(90, '39 - 93', 'อยากทราบความหมายของ39 - 93 ว่ามีข้อดีข้อเสียอย่างไรค่ะ รบกวนด้วยนะคะ', 'DD', 2420, '2013-04-27 21:44:40'),
(57, 'ผลของการเปลี่ยนเบอร์โทรใหม่', 'ไม่ทราบว่าการเปลี่ยนเบอร์โทรใหม่แล้วจะมีผลดีระยะกี่วัน หรือ นานไหมที่เราจะทราบว่ามีผลกับเราแล้ว', '.', 3184, '2013-03-03 21:02:01'),
(58, 'ขอสอบถามครับ', 'คือตอนนี้ผมเรียนจะจบแล้วครับ เรียนสาขาวิทยาการคอมพิวเตอร์ (จบไปเป็นโปรแกรมเมอร์ครับ)ผมเลยอยากจะสอบถามว่าเบอร์ไหนเหมาะกับผมเพื่อให้เจริญในหน้าที่งานการครับ ส่วนนี่คือเบอร์เก่าครับ\r\n0900155655', 'บิณฑ์', 2124, '2013-03-05 19:19:50'),
(59, 'จะเลือกเบอร์ให้ลูกสาว', 'เรียนศิลป์อังกฤษ-ฝรั่งเศษ ควรจะใช้เบอร์ไหยดีค่ะ ///4659154 กับ ///5416459 ใช้แล้วจะได้มีโอกาสไปเรียนต่างประเทศได้ค่ะ', 'วิลาวรรณ', 2240, '2013-03-06 19:54:41'),
(60, 'ขอความอนุเคราะห์ด้วยนะคับ', 'ผมไปซื้อใหม่มา 2 เบอร์ อยากรบกวนถามว่า ผมควรเลือกใช้เบอร์ไหนดีครับ\r\n091-459-9951\r\n086-962-9609\r\nผมเกิดวันอังคาร เดือนกันยายน ปีระกา\r\nขอบคุณมากนะคับ\r\n', 'หนึ่ง', 2090, '2013-03-11 22:25:35'),
(61, 'จองเบอร์ในเว็บแต่ไม่แน่ใจว่าเหมาะรึเปล่า', 'จองเบอร์ในเว็บวันนี้ แต่พออ่านอีกทีไม่แน่ใจว่าจะเหมาะกับตัวเองรึเปล่า แต่ผลรวมได้ดี100% แล้วเบอร์ทีได้0%คืออะไรคะ เลยไม่กล้าเลือก ทำงานเกี่ยวกับการดูแลให้บริการลูกค้า และทำโปรโมชั่นรวมทั้งขายด้วยค่ะ', 'Punn', 2165, '2013-03-12 18:12:05'),
(62, 'จะโทรหาอาจารย์ได้เวลาประมาณไหนดีค่ะ', 'กลางวันทำงาน พอจะคุยกับอาจารย์ก็ดูเวลาแล้วดึกไปหน่อย ไม่กล้ายกหูคุย กลัวจะเป็นการรบกวน อาจารย์นอนดึกมั๊ยค่ะ', 'วิลาวรรณ', 2244, '2013-03-19 21:56:12'),
(71, 'ให้อ.ช่วยตรวจสอบเบอร์หน่อยครับ', 'เบอร์ 09 1992 6541 \r\nเบอร์นี้เป็นอย่างไรบ้างครับ ควรเปลี่ยนหรือไม่\r\nขอบคุณครับ', 'Em', 2119, '2013-03-29 23:46:05'),
(74, 'ถ้าเรามีเบอร์มงคลที่เราเปิดและใช้งานจริงทั้ง 2 เบอร์ แต่ใช้งานเบอร์นึงเยอะกว่าอีกเบอร์ จะมีผลต่อเราอย่างไรบ้างคะ', 'ถ้าเรามีเบอร์มงคลที่เราเปิดและใช้งานจริงทั้ง 2 เบอร์ แต่ใช้งานเบอร์นึงเยอะกว่าอีกเบอร์ คือเบอร์นึงเป็นสมาร์ทโฟนจะใช้งานเยอะ โปรโทร โปรเนทดีกว่า อยากทราบว่าการใช้งานเยอะหรือน้อยการให้ผลของเลขมงคลจะต่างกันไหมคะ ถ้าเราก็ใช้และพกทั้ง 2 เครื่องหน่ะคะ ', 'เมตตามหานิยม', 2354, '2013-04-05 21:21:08'),
(77, 'ไม่อยากเปลี่ยนเบอร์', 'ไม่อยากเปลี่ยนเบอร์ค่ะ ใช้ทำงาน จะแก้ได้ไม๊คะ', 'bee', 2169, '2013-04-12 00:33:46'),
(79, 'รบกวนสอบถามอาจารย์นะคะ', 'อาจารย์คะ หนูมีข้อสงสัยอยากถามค่ะว่า เวลาเราตรวจดวงเบอร์โทรศัพท์ แล้วจะขึ้นคำทำนายมาหลายๆหัวข้อ หมายความว่ามันจะเป็นอย่างทุกๆหัวข้าที่ขึ้นมาเลยใช่หรือเปล่าคะ แล้วตรรกกะสถิติ = 1 หรือ 2 หรือ 3 หมายความว่ายังไงคะ แล้วที่ขึ้นตัวแดงมาให้คือเน้นให้เฟ็นว่าไม่ดีใช่หรือเปล่าคะ ขอบคุณค่ะ', 'pat', 2083, '2013-04-13 08:28:26'),
(80, 'ทำไมผลรวมดี แต่เอามาดูที่นี่แล้วกลับออกมาไม่ดี', 'ตอนแรกหนูจะเปลี่ยนเบอร์ที่ผลรวมดีมากๆเบอร์นึง แต่พอเอามาดูที่เว็บอาจารย์แล้วปรากฏว่าไม่ดี อาจารย์ใช้เกณฑ์อะไรคะ แต่หนูมีเบอร์นึงที่เอามาดูเว็บอาจารย์แล้วดีทุกอย่าง ไม่มีตัวแดงเลย เบอร์ 0861549614 อาจารย์ว่าหนูใช้เบอร์นี้แล้วจะดีมั้ยคะ เบอร์เดิมที่ใช้อยู่ 0856309962', 'พัทธนันท์', 2824, '2013-04-15 18:35:37'),
(82, 'รบกวนสอบถามเบอร์ค่ะ', 'เบอร์0915509245 กะเบอร์ 0869266429\r\nเบอร์ไหนเน้นเรื่องการเงินค่ะ', 'DD', 2080, '2013-04-23 17:57:48'),
(84, 'สอบถามครับ', 'ถ้าผมเกิดวันจันทร์ บ้านเลขที่ 10/188 ดีใหมคับ ถ้าไม่ดีต้องทำไง', 'นวพล', 2097, '2013-04-24 01:20:58'),
(88, 'รบกวนด้วยครับ', 'ผมสอนหนังสือ  แล้วก็เล่นหุ้นด้วย เบอร์นี้  085-9286556\r\nจะทำให้ผมประสบความสำเร็จในเรื่องดังกล่าวหรือป่าวครับหรือต้องมีการปรับเปลี่ยนอะไรเพิ่มเติม', 'ฐณดม', 2204, '2013-04-26 09:20:06'),
(95, 'ต้องดูพื้นดวงประกอบด้วยรึเปล่าคะ', 'ต้องดูวันเดือนปีเกิดประกอบการเลือกเบอร์ด้วยมั้ยคะ\r\nแล้วเบอร์0915250566 เป็นไงบ้างคะ ขอบคุณล่วงหน้าค่ะ', 'ใหม่', 2295, '2013-05-04 03:56:11'),
(97, 'รบกวนสอบถามเบอร์หน่อยคะ', 'ตอนนี้ดิฉันใช้เบอร์0899371000อยู่ แต่เพื่อนทักว่าไม่ดี จึงเข้ามาดูคำทำนายตัวเลข พบว่าตรงกะตัวเองเลยคะ ดิฉันจึงอยากเปลี่ยนเบอร์ตามที่เพื่อนแนะนำ ตอนนี้ดิฉันมี4เบอร์ อยากจะขอความกรุณาเช็คให้หน่อยอะึะว่าเบอร์ไหนที่ดี 086-1563555,086-1563444,086-1563222,085-7388869 ขอบพระคุณคะ', 'Soms', 1995, '2013-05-08 17:15:00'),
(98, 'รบกวนดูเบอร์ให้หน่อยนะคะ^^', '0889542414กับ0824546951 เบอร์ไหนดีกว่ากันอ่ะคะ\r\nเรื่องความรัก งาน เงิน เป็นยังไงบ้างอ่ะคะ ขอบคุณค่า^^', 'Pepo', 1931, '2013-05-11 19:41:36'),
(99, 'ขอความอนุเคราะห์ดูเบอร์ให้ด้วยครับ', 'แต่ก่อนผมใช้เบอร์ นี้ 0876655533 ใช้มา5ปีเต็มๆ ไม่รู้ว่าเพราะผลของเบอร์ หรือเปล่า ชีวิตเต็มๆไปด้วยปัญหา หนี้สินเพิ่มขึ้น ชีวิตไม่มีความสุข  ปัญหามาจากคนข้างกายเสมอ แต่ตอนนี้เปลี่ยนมามาใช้เบอร์ 0899954640 เมื่อปลายเดือนที่แล้ว  และซื้อซิมใหม่ยังไม่เปิดใช้อีกเบอร์ คือ 0914646546  ผมตรวจสอบความเป็นมงคลจากเวปอาจารย์ คะแนนความสุข 70-100% ก็เลยไม่ทราบว่าเบอร์ไหนดีกว่ากัน เหมาะที่จะใช้เป็นเบอร์หลัก วันเกิดผมตามหลักโหราศาสตร์แล้วเป็นวันอังคาร เพราะเกิดตี 2 คืนวันอังคาร อายุ 37 ผมทำงานรับราชการ ที่ต้องบริการประชาชนทางด้านการเงิน รบกวนอาจารย์ดูเบอร์ให้ด้วยครับ ขอบพระคุณอย่างสูง', 'วี', 2149, '2013-05-11 21:02:29'),
(101, 'เพิ่งได้เบอร์มาใหม่รบกวนอาจารย์วิเคราะห์ให้ด้วยค่ะ', '0865096245', 'แหวน', 2269, '2013-05-16 22:21:46'),
(102, 'รบกวนสอบถามเรื่องการเปลี่ยนเบอร์ค่ะ', 'ข้อดีข้อเสียของเลขนี้เป็นไงคะ กำลังตัดสินใจเลือกเบอร์ค่ะ\r\nญ ทำงานบริษัทต่างชาติ ชอบลงทุน โสด (อยากมีคู่ที่ดี) ชอบธรรมะ\r\n- 0x2-45\"9-9-9\"56\r\n- 0x4-565 4 654\r\nเลขไหนเหมาะกว่ากันคะ มีเลข 9 เยอะไปเสียไหมคะ ใจจริงชอบเลขแรกค่ะ\r\nและเลขกาลกิณีตามวันเกิดมีผลไหมคะ?', 'ฟ้า', 2025, '2013-05-19 01:57:27'),
(107, 'ขออนุญาตนะคะ รบกวนอาจารย์ช่วยดูเบอร์ให้หน่อยคะ', 'พอดีว่าเพิ่งได้เบอร์มาใหม่อ่ะค่ะ\r\nต้องการเน้นในเรื่องของการเงินให้ดีขึ้น เก็บเงินได้ แล้วก็ในเรื่องของอารมณ์ที่ร้ายๆให้ดีขึ้นอ่ะค่ะ\r\nไม่ทราบว่าเบอร์นี้ใช้แล้วจะดีขึ้นมั้ยคะ', 'มึนตึ้บ', 2170, '2013-05-22 00:22:08'),
(1048, 'รบกวนอาจารย์แนะนำหน่อยค่ะ', 'หนูมีเบอร์ที่ใช้อยู่แต่จะหาเบอร์มาเสริมค่ะอาจารย์\r\nจะเลือกอันไหนดีคะ รบกวนอาจารย์ช่วยวิเคราะห์หน่อยค่ะ เบอร์ที่ใช้ xx64642965\r\nเบอร์ที่เลือก xx24546959, xx24454695, xx42645365\r\nของคุณค่ะ\r\n', 'Anne', 1975, '2019-08-20 11:17:08'),
(110, 'ช่วยเลือกเบอร์ให้หน่อยค่ะ', 'ระหว่าง 3 เบอร์นี้ค่ะ จะเก็บไว้ใช้ 2 เบอร์ ควรตัดเบอร์ไหนออกดีคะ\r\n1.089-265-5199\r\n2.088-246-2220\r\n3.088-514-0997', 'ทิพย์วรรณ', 1883, '2013-05-28 08:43:55'),
(118, 'อยากจะรู้ว่าเบอร์ที่ใช้ปัจจุบันนี้ดีหรือไม่ ', 'อยากจะทราบว่าเบอร์โทรที่ใช้ในปัจจุบันนี้ดีหรือไม่ดี เเละสมพงษ์กับงานที่ทำด้วยหรือเปล่าคะ\r\nเบอร์ 089-453-1246 ', 'Annie', 1875, '2013-06-05 13:38:51'),
(119, 'อยากเปลี่ยนเบอร์ให้พ่อและเเม่คะ', 'คืออยากรบกวนอาจารย์ดูเบอร์ให้พ่อกับแม่นะคะ \r\nพอดีลองทำนายเบอร์ที่ท่านทั้ง 2 ใช้อยู่ในปัจจุบันไม่ดีขึ้นเลย เลยอยากจะหาเบอร์ดีๆให้ท่านทั้งสองคนใช้นะคะ ', 'แอน', 1964, '2013-06-05 13:56:57'),
(121, 'รบกวนอาจารย์ช่วยดูเบอร์ให้หน่อยค่า', 'ตอนนี้กำลังศึกษาปี 4 ยุค่า แล้วจะต่อเนติ เบอร์เก่าเป็น 0866066306 จะเปลี่ยนเบอร์เป็น 0895351924 อาจารย์ว่าเบอร์นี้ดีไหมค่า คือเลขเบอร์นี้อยู่ในกลุ่มของ เหมาะกับงานบริหารวางแผนยุทธศาสตร์ งานวิชาการ ครูบาอาจารย์ อัยการ ผู้พิพากษา แพทย์ วิทยากร ผู้ที่ถ่ายทอดความรู้ให้ผู้อื่น ซึ่งตอนนี้หนูกำลังศึกษาอยู่อ่าค่าจะไปทางศาล และที่ใจเลือกเบอร์นี้ด้วยเพราะเห็นว่า เป็นเลขที่ต้องเป็นผู้ที่ถ่ายทอดความรู้ให้ผู้อื่นซึ่งหนูคิดว่าน่าจะช่วยในเรื่องการเขียนตอบข้อสอบกฏหมาย จึงอยากให้อาจารย์ช่วยแนะนำหน่อยค่า ว่าเบอร์ที่เลือกนี้ ดีไหมค่า หรือต้องเลือกยังไงค่า รบกวนอาจารย์ช่วยดูให้ด้วยค่า:D', 'เบญญาภา', 2918, '2013-06-22 18:55:05'),
(122, 'iPad ต้องใช้เบอร์ดีไม๊คะ ขายของใน facebook ค่ะ', 'อยากทราบค่ะอาจารย์ เพราะมันก็เป็นเบอร์เหมือนกัน ถึงจะไม่ได้ใช้โทร แต่ก็ถือว่าใช้บ่อยกว่ามือถือตอนขายของอ่ะค่ะ. ขอบพระคุณล่วงหน้าค่ะอาจารย์', 'Sweet wonder', 2064, '2013-06-22 22:58:33'),
(123, 'สอบถามครับ เบอร์ลงท้าย00', 'เบอร์ 0855298900 รวมได้46\r\nดีมั้ยครับ หรือควรเปลี่ยน\r\nแล้วอีกหนึ่งเบอร์นะครับ\r\n0826292653', 'thanatch', 2439, '2013-06-25 09:17:19'),
(133, 'เบอนี้ดีไหม', 'รบกวนถามคร้า เบอ0932963465เบอนี้ดีไหมคะ', 'Aun', 1912, '2013-07-19 11:33:23'),
(1156, 'คะแนนที่ไม่ขึ้น % อัตราส่วนเบอร์ดี', 'สมมุติอย่างเบอร์ 099-8789899,0946416566 ทำไมคะแนนไม่ขึ้นอะครับ', 'คะแนนที่ไม่ขึ้น % อัตราส่วนเบอร์ดี', 1905, '2020-10-26 20:19:13'),
(129, 'วิเคราะห์เบอร์', 'เวลาวิเคราะห์เบอร์ต่างๆ ต้องดู ว/ด/ป  ด้วยรึเปล่าคะ มีผลมากน้อยแค่ไหนคะ \r\n\r\nและเบอร์ 0889561559 ถ้าใช้ในเรื่องงาน จะไม่น่าใช้รึเปล่าคะ เพราะจะทำให้หน้าตาบูดบึ้ง ไม่น่ารัก ไม่ต้อนรับลูกค้าเปล่าคะ\r\nขอบคุณค่ะ', 'nc', 2451, '2013-07-10 02:50:27'),
(130, 'สอบถามเบอร์เพิ่มเติมค่ะ', 'ขอถามอีกรอบนะคะ เบอร์ 0889561559 กับ 0894409393 1.2เบอร์นี้เบอร์ไหนดีกว่ากันคะ \r\n2.และถ้าอยากจะกระตุ้นให้ทำอะไรได้เร็วขึ้น และกล้าคิดกล้าตัดสินใจ 2 เบอร์นี้เบอร์ไหนช่วยเป็นเบอร์เสริมนี้ได้คะ หรือต้องใช้เป็นเบอร์อื่นเลยคะ \r\n\r\nขอบคุณนะคะ', 'nc', 1954, '2013-07-10 11:37:26'),
(960, 'วิธีการจองเบอร์', 'วิธีการจองเบอร์ ต้องทำยังไงคะ และ แต่ละเบอร์ ผูกแพคเกจไว้รึป่าว ต้องสอบถามที่ไหน ', 'กุ้ง', 1955, '2017-08-17 12:18:18'),
(138, 'อยากรู้หมวดหมู่อาชีพสำหรับการเปลี่ยนเบอร์ใหม่', 'อยากเริ่มต้นทำธุรกิจ  โดยเราติดต่อลูกค้า ส่งออเดอร์ให้โรงงานแล้วได้เป็นคอมมิชชั่น หรือกินส่วนต่าง ควรหาเบอร์จากหมวดหมู่อาชีพใดคะ  \r\nทำเป็นสินค้าประเภทพรีเมี่ยม กระเป๋า หมวก ปากกา ประมาณนี้ และอาจประมูลงานราชการในบางรายการด้วยคะ \r\n', 'ฝน', 1960, '2013-07-25 13:58:46'),
(140, 'รบกวนดูเบอร์ให้หน่อยคับ ', '0925640564 ดีมั้ย ดีเรื่องอะไรบ้างคับ', 'ตั๊ก', 2039, '2013-07-27 15:54:45'),
(141, 'ขอความอนุเคราะห์ช่วยดู', '0879296650\r\n0805594551\r\n0844649469\r\n0844517942\r\n0844545252\r\nเบอร์เหล่านี้ถ้าจะถามว่าควรจะเลือกเบอร์ไหนที่น่าใช้งานมากที่สุดครับ ที่คนส่วนใหญ่จะถามถึง  *** โชคลาภ การงาน การเงิน ความรัก สุขภาพ*** \r\nและเป็นเบอร์ที่เหมาะสำหรับคนที่ทำงานด้านการศึกษา (เบื้องหลัง มีสอนบ้างบางครั้งคราว) สำหรับคนเกิดวันพฤหัสฯ ที่ 22 มี.ค. 2522 เวลาเที่ยงครึ่ง\r\nเบอร์ไหน ส่วนตัว เบอร์ไหนงาน', 'nosoda', 2082, '2013-07-28 16:26:06'),
(145, 'ดูให้หน่อยครับ ว่าเบอร์ไหนควรปิด ชักไม่แน่ใจ', '0884944995 เบอร์นี้ให้อาจารย์หมอดูเลือกให้ ใช้มา 2 ปีกว่าแล้ว แต่พอมาเช็คในเว็บนี้ และ เว็บ somjade ค่าดีน้อยมาก  ผิดกับเบอร์ 0879595997 ที่ผมหามาเอง ค่าอยู่ที่ 700-100  ส่วนเบอร์ล่าสุด 0924414151 เบอร์นี้พึ่งได้มาใหม่ๆ ใช้เล่น 3G ครับ หลักๆ ก็ใช้แค่ 3 เบอร์นี้แหละครับ', 'Benz', 2199, '2013-08-05 16:08:44'),
(152, 'ขอคำแนะนำเรื่องเบอร์ครับ', 'มีใช้อยู่สองเบอร์คือ0915291564ใช้โทรรับสาย\r\nอีกเบอร์คือ0866952591ใช้เล่นเนตและโทรออก\r\n\r\nเกิดวันศุกร์19/08/26  อาชีพพิธีกร  วิทยากร  อาจารย์\r\n\r\nควรปิดเบอร์ไหนหรือไม่ครับและเบอร์เสียหรือไม่ครับควรใช้ต่อหรือไม่ขอคำแนะนำครับ\r\n\r\nขอบคุณมากครับ\r\n', 'sakda', 2006, '2013-08-15 07:09:40'),
(154, 'ตัวเลขกาลกิณี', 'ถ้าเราจะใช้เบอร์โทรศัพท์ที่มีค่าตัวเลขแต่ละตัวดีแต่มีตัวเลขที่เป็นกาลกิณีกับวันเกิดจะมีผลเสียมากน้อยยังไงมั่งค๊ะ...ขอบคุณค่ะ', 'ภณิดาพร', 2355, '2013-08-17 12:36:47'),
(158, 'เบอร์ที่เหมาะสมกับอาชีพ', 'เรากับน้องสาว ใช้เบอร์ 0866566542, 0866566454\r\nเปิดร้านขายของ+ขายทางออนไลน์ด้วย ประเภทเสื้อผ้า กระเป๋า เครื่องประดับ รองเท้าแฟชั่น \r\nอยากให้อาจารย์ดูให้หน่อยคะว่าเหมาะกับอาชีพมั้ย ควรปิดเบอร์ไหนหรือเปล่า\r\n\r\nขอบคุณคะ', 'เมย์', 2322, '2013-08-23 11:29:39'),
(164, 'สอบถามเรื่องเบอร์โทรศัพท์ค่ะ', 'ขอคำเเนะนำหน่อยค่ะว่าเบอร์ 094-2622654 ถ้าจะใช้เป็นเบอร์ส่วนตัวติดต่อครอบครัว เพื่อน คนรัก เหมาะสมมั๊ยค่ะ  เเล้วจะช่วยหนุนเรื่องกิจการค้าขาย เงิน งานรึเปล่าคะ อยากเริ่มต้นทำธุรกิจส่วนตัว\r\n\r\nขอบคุณล่วงหน้าค่ะ', 'pk', 1944, '2013-08-27 18:41:12'),
(168, 'เรียนถามเบอร์ครับ', 'เบอร์ 09-4462-4956 เป็นอย่างไรบ้างครับครับ เพิ่งเปิดไม่ถึงเดือน..ขอบพระคุณมากครับ', 'วัฒน์', 1969, '2013-09-02 00:42:47'),
(172, 'รบกวนปรึกษาค่ะ', 'เบอร์ระหว่าง 0845422654 กับ 0842642269 เบอร์ไหนดีกว่ากันค่ะ', 'ชินจัง', 2121, '2013-09-07 17:04:50'),
(176, '789', 'ถ้าเราใช้เบอร์นี้แต่เราไม่ได้เล่นการเมือง ปกครองคน..เบอร์จะออกเหตุออกผลมั๊ยค๊ะ..789 อยู่หลัง', 'หนิง', 3562, '2013-09-14 15:28:32'),
(177, 'อยากเปลี่ยนเบอร์มือถือให้พ่อค่ะ', 'พ่อทำอาชีพขับรถบรรทุกหินดินทรายค่ะ อยากเปลี่ยนเบอร์ให้พ่อค่ะ ควรมีหรืิอเลี่ยงตัวเลขไหนค่ะ \r\n\r\n', 'ขวัญ', 2395, '2013-09-15 10:51:31'),
(179, 'ขอคำปรึกษา และแนะนำด้วยครับผม', 'เดิมทีใช้เบอร์มาหลายปีครับ\r\n082-2620839 ผมใช้\r\n086-2904041 แฟนใช้\r\nแล้วเปลี่ยนเป็น\r\n085-1831539  ผม\r\n092-4356566  แฟน\r\nผมเป็นครู และ เป็นนักลงทุน ในหุ้น พวก Forex\r\nแฟน อยู่บ้านครับผม\r\nไม่ทราบเบอร์ที่ผมเลือกใช้ ถุกต้องไหมครับ หรือว่าควรปรับเปลี่ยนยังไงบ้างครับผม', 'วี', 1990, '2013-09-17 11:58:05'),
