(183, 'สอบถามเบอร์์ที่เกี่ยวกับคว่ามรักค่ะ', 'เบอร์ #095-696-624,. \r\n   #095-624-1556,. \r\n  \'#095-696-2655    เบอร์ไหนให้ผลดีด้านความรักมากกว่ากัน มีข้อเสียน้อยกว่าคะ  \r\n. \r\nขอบคุณมากค่ะ\r\n', 'panumars', 3462, '2013-09-21 20:43:51'),
(189, 'สอบถามเบอร์ค่ะ', 'ตอนนี้ใช้เบอร์ 0856156059 เบอร์ส่วตัว และ กำลังจะใช้ 0824549249 เบอร์สำหรับธุรกิจรับนำเข้าสินค้าจากต่างประเทศและงานติดต่อการค้ากับต่างประเทศค่ะ ไม่ทราบว่าเบอร์โอเคมั้ยค่ะ หรือวรเปลี่ยน เสริมด้านไหนบ้างค่ะ ขอบคุณค่ะ', 'แก้ม', 1848, '2013-09-29 17:34:06'),
(261, 'ใช้เบอร์นี้อยู่ ไม่ทราบว่าดีหรือเปล่าคะ ', 'ใช้เบอร์นี้อยู่ ไม่ทราบว่าดีหรือเปล่าคะ เรื่องงาน เรื่องคู่ดีไหมคะ  092-6941566', 'lolita', 2122, '2014-01-13 12:21:58'),
