(201, 'ขอคำแนะนำเบอร์ใหม่ค่ะ', ' ทำงานเป็นนักการตลาดของบริษัท พัฒนาอสังหา เพิ่งเริ่มเป็นนักลงทุนรายย่อยด้วยค่ะ ต้องการส่งเสริมเรื่องหน้าที่การงานให้มั่นคง มีเหตุให้เปลี่ยนงานบ่อย และต้องการเสริมการเงินหมุนคล่อง ยังไม่มีครอบครัวค่ะ และบริวารให้ค่อยเชื่อฟัง ส่วนตัวเป็นใจร้อน ทำอะไรรวดเร็ว มั่นใจเกิน100\r\nควรเลือกใช้เบอร์ไหนดีค่ะ เพื่อปรับสมดุล\r\nจากด้านล่างนี้ เลือกมาบางส่วน แต่ไม่มั่นใจตรงกลุ่มหรืไม่ค่ะ\r\n0924142926 ,0849429742, 0924142939\r\n0924191516, 0924142993, 0924142989\r\nขอบคุณค่ะ', 'สวิส', 2381, '2013-10-12 21:55:20'),
(202, 'รบกวนช่วยดูเบอร์ให้หน่อยค่ะ', 'พอดีเพิ่งเปลี่ยนเบอร์โทรศัพท์ใหม่ให้คุณแม่ไม่กี่วันที่ผ่านมา ก็เกิดอุบัติเหตุ รบกวนอาจารย์ช่วยดูให้หน่อยได้มั้ยค่ะ ว่าเบอร์ดีมั้ย 094-426-9650 อาชีพแม่บ้านค่ะ\r\nหรือว่าเบอร์เก่าใช้จะดีกว่า (090-048-8958)', 'ทิพย์', 2098, '2013-10-14 21:30:59'),
(219, 'วันเกิดกับเบอร์โทรค่ะ', 'ลำพังเลขสวยหายากอยู่แล้ว ต้องเว้นเลขด้วยค่ะ ถ้าจะมีเบอร์โทรสักเบอร์ ต้องดูจากวันเกิดด้วยเหรอคะ เลขที่เขาแนะนำให้ เราไม่ชอบ รู้สึกไม่ถูกชะตา ควรตัดสินใจเลือกจากอะไรดีคะ', 'destiny', 2123, '2013-11-12 22:39:05'),
(224, 'ใช้เบอร์ไหนดี', 'รบกวนหน่อยค่ะระหว่างเบอร์ 0926915626 กับเบอร์ 0929455254 ใช้เบอร์ไหนดี เกิดวันศุกร์ทราบมาว่า ทั้ง91 และ 25 ไม่ค่อยเหมาะกับผู้หญิง', 'ครูนัฐ', 2005, '2013-11-18 11:10:27'),
(228, 'เบอร์คะแนนดี', 'ถ้าได้คะแนน 60% ถือว่าใช้ได้หรือเปล่าครับ ช่วยเช็คดูว่าเบอร์นี้ดีหรือไม่ครับ 094 774 1565', 'พรชัย', 2150, '2013-11-20 09:51:15'),
(233, 'Number for Air Card', 'จองเบอร์0955949249ไปค่ะ ต้องการใช้กับแอร์การด์ truemove 3g Hซิมนี้ใช้ด้วยกันได้เหรึเปล่าค่ะ\r\n\r\nปัจจุบันใช้เบอร์0924191516ซื้อมาจากทางอาจารย์ค่ะ', 'สวิส', 2400, '2013-12-01 14:12:01'),
(246, 'เอาเบอร์มาใช้คู่กันเหมาะสมไหมครับ', 'ตอนนี้ผมเปลี่ยนเบอร์ตัวผมแล้ว และเปลี่ยนให้แม่ด้วยแต่ใช้คนละสองเบอร์ดังนี้ครับของ\r\nผมคือ 0915291564   /  0924292562\r\nของแม่คือ  0826545596  / 0949419959เบอร์หน้าจะเป็นเบอร์หลักส่วนเบอร์หลังคือเบอร์รอง สอบถามว่าสมควรตัดเบอร์ไหนออกไหมครับไม่อยากให้ขัดแย้งกันเวลาใช้ของผมมีเลข62ปิดท้ายจะเสียไหม  ส่วนของแม่มีเลข94 ในเบอร์ขัดแย้งไหม\r\n\r\nแม่ไม่สบายมาหลายเดือนแล้วมันเกี่ยวกับที่ผมปลี่ยนเบอร์ให้เขาไหม   ขอบคุณครับ', 'ศักดา', 2700, '2013-12-21 12:04:22'),
(247, 'อยากมีโชคด้านการเงิน', 'อยากมีโชคด้านการเงิน เช่นลอตเตอรี่ หุ้น ถ้าใช้เบอร์0879719996 จะดีไหมครับ เบอรนี้ต้องระวังอะไรไหม ผมเกิดวันศุกร์\r\nปล.ยังไม่ได้เปิดเบอรครับ อยากทราบก่อนตัดสินใจใช้จริง', 'รัฐ', 2703, '2013-12-22 22:31:53'),
(252, 'สอบถามเบอร์ค่ะ', 'สวัสดีค่ะ ปัจจุบันดิฉันใช้ XX4-5614695 2เดือน กำลังจะเปลี่ยนเบอร์เป็น XX4-6944159 และใช้เบอร์สำรอง XX3-9651665 *อาชีพพนักงานธนาคารวิเคราะห์สินเชื่อรถยนต์(รายละเอียดงานสอบถามข้อมูลลูกค้าทางโทรศัพท์ ดูเอกสารการเงินและเอกสารประกอบอาชีพประกอบการพิจารณา) *อนาคตอาจจะเปิดกิจการค้าขายกาแฟสด,ร้านอินเตอร์เน็ต รบกวนอ.พิจารณาข้อดีข้อเสีย ทั้ง 3เบอร์ให้หน่อยนะค่ะ แล้วถ้าต้องการเลือกเพียง 1 เบอร์ ควรใช้เบอร์ไหนเหมาะสมกว่ากันค่ะ และถ้าใช้ 2 เบอร์คู่กัน ควรใช้เบอร์อะไรค่ะ *เน้นการงานก้าวหน้า,ผู้ใหญ่สนับสนุน,มีเงินเหลือใช้ไม่เดือดร้อน,สุขภาพแข็งแรงค่ะ ขอบพระคุณมากๆค่ะ', 'เอ๋', 1928, '2013-12-30 17:04:18'),
(259, 'เบอร์นี้เปนไงบ้าง', '0874796296', 'อ้วน', 2383, '2014-01-09 17:16:19'),
(1139, 'ขอคำแนะนำำ อาจารย์ป๋วยค่า', 'อาจารย์ป๋วยคะ ตอนนี้หนูใช้เบอร์ 0826426536 เป็นเเบอร์ส่วนตัว คุยกับครอบครัว และใช้เบอร์ 0926146359 ใช้เบอร์คุยเรื่องงาน และกับบุคคลอืน จะเป็นอย่างไรบ้างคะ เบอร์เสริมหนูใช้มาได้ 6-7 เดือนแล้วค่ะ', 'นภัทร', 1784, '2020-08-25 21:04:59'),
(1096, 'รบกวนอาจารย์วิเคราะห์ 2 เบอร์นี้หน่อยครับ', 'อาชีพเป็นครู เดิมใช้เบอร์ 0946974516 ดีไหมครับ ถ้าไม่เหมาะจะเปลี่ยนมาใช้เบอร์ 0629166519 หรือเบอร์0619515662 ได้ไหมครับ และควรใช้เบอร์ไหนดีครับ', 'วิชาญ', 1924, '2020-03-19 21:09:36'),
(272, 'เบอร์ส่งเสริมด้านสุขภาพ', 'พอดีคุณแม่มีโรคประจำตัวอยู่ครับอาจารย์ ท่านเป็นเบาหวาน หากจะหาเบอร์ที่ีช่วยส่งเสริมสุขภาพให้ท่าน ระหว่างเบอร์ที่ท่านใช้ปัจจุบันคือ 0824555922 และเบอร์ 0950495993 และเบอร์ 0850454593 เบอร์ไหนที่ช่วยส่งเสริมสุขภาพ ครับ', 'NOSODA', 2152, '2014-01-25 15:42:20'),
(276, 'อยากทราบว่า เบอร์ที่กำลังจะเปลี่ยนดีไหมคะ', 'ปกติ เบอร์ ที่ใช้อยู่ คือ 0875421151\r\nแล้วตอนนี้ซื้อเบอร์ 0944595265\r\nไม่ทราบว่า จะเปลี่ยนดีไหม\r\nเพศหญิงค่ะ อยากทำธุรกิจส่งออกผลไม้อบแห้งค่ะ\r\nรบกวนด้วยนะคะ', 'นส จีรานันทน์ ทองสมุทร', 2184, '2014-02-02 22:33:01'),
