(280, 'อยากสอบถามเบอร์ว่ายกเลิกเบอร์ไหนดีกว่ากัน', 'อยากสอบถามเบอร์ว่ายกเลิกเบอร์ไหนดีกว่ากัน ระหว่างเบอร์ 0831331225 และเบอร์0830342887', 'Fujioda', 1939, '2014-02-04 18:27:09'),
(289, 'รบกวนช่วยตรวจสอบเบอร์ให้หน่อยค่ะ....', 'พอดีทำงานอยู่ร้านยา ใช้เบอร์ 0949869596 เกิดวันศุกร์  ที่12เมษา2528  การงานการเงินจะดีมั้ยค่ะ?ควรเปลี่ยนเบอร์รึป่าว...ขอบคุณค่ะ', 'ณัฐปภัสร์', 1841, '2014-02-12 22:54:05'),
