(284, 'สอบถามเรื่องเบอร์ที่กำลังที่เปิดใช้ครับ', 'สอบถามเรื่องเบอร์ที่กำลังที่เปิดใช้ครับ เบอร์0946915615 เรื่องงานดีไหมครับ คิดจะเปลี่ยนย้ายงานครับ', 'Fujioda', 2581, '2014-02-05 18:58:50'),
