(295, 'รบกวนขอสอบถามหน่อยครับ', 'ปัจจุบันผมใช้เบอร์ 0x56565996 อยู่ครับ แต่เผอิญว่ามีคนทักว่าจะขี้เกียจและใช้เงินเก่ง ผมเลยหาเบอร์มาได้2เบอร์ครับ คือ 0x29156356 กับ 0x29425635 ครับ ไม่ทราบผมควรใช้เบอร์ไหนดีครับ \r\n\r\nผมทำงานเกี่ยวกับคอมครับ เกิดวันที่ 8 เดือน ธ.ค. 2526 ครับ\r\n\r\nขอบพระคุณล่วงหน้าครับ', 'Rexx', 2276, '2014-02-19 20:43:32'),
