(311, 'สอบถามค่ะ ซท้อเบอร์เพิ่มมา 0959299919', 'ปัจจุบันใช้ 0924191516ค่ะ \r\n\r\nพอดีซื้อเบอร์เพิ่มมาคือ0959299919เพื่อใช้เรื่องงานส่วนตัวแยกจากบริษัทเกี่ยวกับนายหน้าอสังหา ผู้หญิงใช้เบอร์นี้ได้มั้ยค่ะ เห็นเขียนว่าเหมาะผู้ชาย', 'ริน', 2091, '2014-03-23 13:14:13'),
