(318, 'รบกวนขอคำแนะนำด้วยครับ', 'ผมใช้สองเบอร์\r\n0939264496\r\n0955409626\r\nตอนนี้ผมทำงานเกี่ยวกับตัวแทนประกันชีวิต\r\nและอาจจะมีงานพิธีกรด้วย\r\nไม่ทราบว่าเบอร์ทั้งสองเหมาะกับผมไหมครับ\r\nคือผมอยากขายประกันง่ายๆขายคล่อง มีคนเมตตา และสมหวังเรื่องความรัก', 'tri', 2108, '2014-03-31 23:39:24'),
(324, 'เบอร์โทรศัพท์จะช่วยเรื่องความรักอย่างไรได้บ้าง', 'เป็นโสดอยู่ครับ โสดประเภทจีบใครไม่เคยติด หลายปีมาแล้ว ใช้เบอร์โทร 084-9957610 ตอนนี้ถอดซิมเบอร์นั้นออกจากเครื่องแล้ว มาใช้เบอร์โทรใหม่เป็น 089-1529419 ไม่กี่เดือนที่ผ่านมา และจากวันเกิดผมนี้ 1 ธันวาคม 2522 เวลา 21.45 โรงพยาบาลอำเภอเมืองจังหวัดสงขลา จากอิทธิพลของเบอร์โทร 089-1529419 นี้ ผมพอจะมีโอกาสพบเจอกับเนื้อคู่ คู่ครอง ได้อย่างไรบ้าง เช่น เพื่อนสนิทรู้จักกันมานาน ผู้คนที่รู้จักกันในโลกออนไลน์ หรือ แบบว่าไม่เคยรู้จักกันมาก่อนปล้วพบเจอกันบังเอิญตาม ข้างถนน หรือศูนย์การค้าต่างๆ งานเลี้ยง ร้านหนังสือ ห้องสมุด', 'เป้ ผลชนะ', 2630, '2014-04-09 09:41:20'),
(328, 'คำทำนาย กับผลรวมตัวเลข?', 'ตรวจเบอร์มือถือกันี้แล้วดีมากไม่มีขึ้นสีแดงเลยแต่พอบวกรวมทุกตัวแล้วได้58ซึ่อี', 'จำมัย', 2041, '2014-04-12 09:26:46'),
(330, 'บอร์นี้จะช่วยส่งเสริมเรืองความรักด้วยหรือไม่ค่ะสำหรับผู้หญิง', 'เพิ่งเปลี่ยนมาใช้เบอร์นี้ได้ 4 เดือนค่ะ ตั้งแต่ปีใหม่  เบอร์ 086-519-4559 \r\nและสำหรับเบอร์ความรัก อาจารย์แนะนำเลขใดดีคะ\r\nขอขอขพระคุณค่ะ', 'Tata', 2019, '2014-04-16 12:26:10'),
