(340, 'อยากได้เบอร์ที่ความหมายเน้นเรื่องความรักดี สุขภาพดี และเงินทองค่ะ', 'อยากรบกวนอาจารย์ช่วยแนะนำเบอร์ที่เน้นความหมายเรื่องชีวิตรักดีๆสมหวังให้ได้ไหมคะ อยากได้มาใช้อีกเบอร์ค่ะ  \r\n\r\nเนื่องจากปัจจุบันนี้ มีครอบครัวแล้วค่ะ ลูก 1 คน อายุ10เดือน สามีทิ้งไปอยู่กับ ผญ อื่น จึงอยากได้เบอร์ที่เน้นเรื่องความรักดีๆคะ เผื่อจะช่วยให้สมหวังสามีกลับมาบ้าง เนื่องจากก่อนหน้านี้ใช้เบอร์ 081-หนึ่งสี่หก -สี่สามสี่สาม แล้วรุ้สึกตัวเองฝีปากดีมาก กล้าด่า กล้าพูดตรงๆจนสามีรับไม่ได้ในความเลือดร้อนของเราคะ\r\n\r\n ความหมายที่เกี่ยวกันรองมาคือ สุขภาพกายใจดี และก็เงินทองนะคะ (เรียงลำดับความสำคัญให้แล้วค่ะ)\r\n\r\nตอนนี้เปลี่ยนมาใช้ใช้เบอร์ 085-หกแปดเก้า-เก้าสองสี่ห้า ค่ะ ไม่ทราบว่าดีร้ายอย่างไร รบกวนอาจารย์แนะนำด้วยนะคะ', 'แม่ลูกอ่อน', 3887, '2014-05-02 00:44:51'),
(341, 'อยากได้เบอร์ที่ส่งเสริมเรื่องความรักและสุขภาพ', 'เบอร์ 0xx-789-2615 ไม่ทราบว่าดีหรือไม่ครับสำหรับความรักและสุขภาพ หรือถ้าไม่ควรใช้จะแนะนำเป็นตัวเลขไหนดีครับ', 'บอย', 1950, '2014-05-03 00:50:59'),
