(979, 'อาจารย์คะ หนูใช้เบอร์××42415999 เหมาะสมมั้ยคะ', 'อาจารย์คะ หนูทำงานประชาสัมพันธ์ในโรงพยาบาล คอยอำนวยความสะดวกคนไข้ ในขณะเดียวกันหนูก็ปฏิบัติธรรมศึกษาธรรมะด้วยค่ะ หนูใช้เบอร์นี้มา 7 เดือนแล้วค่ะ จะปิดกั้นเรื่องเงินกับความรักมั้ยคะ มีคนบอกว่าถ้าใช้5999จะขึ้นคาน เลยจิตตกนิดนึงค่ะ ', 'กัญญาภัทร', 1875, '2018-04-16 22:56:05'),
