(1021, 'โปรโมชั่นใหม่ “แจกโบนัส สูงสุดทันที  1,000 บาท”', '.....โปรโมชั่น แบบครบวงจรที่คอยอัพเดทข่าวสารเกี่ยวกับโปรโมชั่น..... บาคาร่าออนไลน์ <u><font color=\"#000120\">.....</font></u>ตลอดทั้ง 24 ชั่วโมง เพื่อให้ท่านได้สามารถเข้าร่วมสนุกไปกับเกมออนไลน์ของเราได้ตลอดเวลาโปรโมชั่นสำหรับสมาชิก Premium, VIP ที่แจกโบนัสให้สูงที่สุด 10% และโปรโมชั่นแบบรายวัน สำหรับคำขอบคุณที่มอบให้กับ โปรโมชั่น.....', 'asd', 2803, '2019-05-13 15:20:32'),
(1054, 'รบกวนขอสอบถามในการเลือกเบอร์หลัก', 'เบอร์ที่ใช้ ปัจจุบัน 086-6955914\r\nเบอร์ที่จะใช้เป็นเบอร์ที่ 2 คือ 0655165166\r\nหนูควรใช้เบอร์ไหนเป็นเบอร์หลักค่ะ เบอร์ทั้งสองมีความแตกต่างกันด้านไหนค่ะ\r\nทำงานตำแหน่ง ผู้จัดการทั่วไป', 'Aloha', 1994, '2019-09-08 21:35:52'),
