(379, 'อยากให้อาจารย์แนะนำเบอร์นี้ด้วยครับ', 'ถ้าทำงานเกี่ยวกับค้าขายออนไลน์ (อาชีพหลัก) และมีอาชีพเป็นครูสอนฟิตเนส (อาชีพเสริม) ถ้าจะใช้เบอร์ 089-789-2615 จะดีไหมครับ (ตอนนี้ยังไม่เปิด เพิ่งได้ซิมมาครับ) เพราะเบอร์เดิม (086-883-8880) มีแต่คนทักว่าให้เปลี่ยน ', 'ออฟ', 1780, '2014-06-29 00:02:51'),
