(381, 'ลงเว็บสมัครหางาน ใช้เบอร์ไหนดีค่ะ มีสองเบอร์ค่ะ รบกวนเวลาอาจารย์หน่อยนะค่ะ เพิ่งเรียนจบค่ะ', 'เบอร์ที่ 1. 093 529 5655\r\nเบอร์ที่ 2. 095 524 2426\r\n\r\nหนูเรียนมาทางด้านตกแต่งภายในค่ะ อยากให้มีโชคและข่าวดีในการสมัครงานค่ะ \r\nอยากได้งานทำเร็วๆค่ะ\r\n\r\nขอบพระคุณอาจารย์ล่วงหน้า ที่ตอบหนูนะค่ะ ', 'เจนจิรา', 1998, '2014-07-05 16:36:29'),
(382, 'ขอความอนุเคราะห์ ตรวจสอบเบอร์ให้หน่อยนะครับอาจารย์', 'เบอร์ 093 529 5655 เบอร์นี้ผมใช้ได้ไหมครับ (ได้มาจากน้องสาว)\r\nพอดีลองใช้โปรแกรมทำนายเบอร์ในเว็บดูแล้ว\r\nแต่อยากให้มั่นใจเลยอยากจะขอรบกวนอาจารย์อีกทีครับ\r\n\r\n', 'จันทร์', 1726, '2014-07-06 10:14:41'),
(386, 'ช่วยเลือกเบอร์', 'xxx6195391 \r\nxxx 6195397\r\n\r\nลูกจ้าง ค้าขาย เกี่ยวกับติดต่อต่างประเทศ เถ้าแก่เนี่ย. เสี่ย\r\nขาย เครืองจักร ไฟฟ้า และขายที่ดิน อัญมณี\r\n\r\nอยากเน้น ทำงานเก่ง มีแนวคิดโปรเจคใหม่ๆ\r\nได้เลื่อนขั้นไว\r\nถูกเลือกให้เป็น หัวหน้าคุมสาขา และต่อยอดเป็นเจ้าของธุรกิจเอง\r\nใจไม่ร้อน เป็นผู้ใหญ่\r\n\r\n', 'smi', 1692, '2014-07-11 14:02:47'),
