(978, 'แฟนตกงานมีจะ2 ปี เรารับภาระคนเดียวทุกอย่าง', 'รบกวนขอความช่วยเหลืออาจารย์คะ\r\nข้อมูลส่วนตัว\r\nแฟน เกิดวันอาทิตย์ 27/11/2526\r\nเบอร์มือถือที่ใช้ 0809952986 ใช้มา5-6 ปี\r\nส่วนตัวเอง เกิดวันศุกร์ 11/08/2521\r\nเบอร์มือถือที่ใช้ 0886100111 ใช้มา 6-7ปี\r\n\r\nแฟนที่คบกันมา 9 ปี (ยังไม่ได้แต่งงานกัน)\r\nเริ่มคบกันเค้าทำงานมีรายได้แน่นอนและอยากเรียนให้จบปริญญาเราก็สนับสนุน ช่วง4-5 ปีแรกทุกอย่างไม่มีปัญหา เป็นปกติ \r\nแต่พอหลังจากเรียนจบ ทุกอย่างค่อยๆแย่ขึ้น เรื่องงานแย่ลง ออกจากงานว่างอยู่ครึ่งปีจึงได้งานใหม่ ทำไปได้1 ปีก็ออกจนถึงปัจจุบันว่างงานมาแล้ว1 กับอีก 4 เดือน ทุกวันนี้ไม่มีความกระตือรือร้น ไม่ใส่ใจหางาน ใช้ชีวิตแย่ไร้แก่นสาร (วันๆเอาแต่เล่นเกม เล่นมือถือ กินน้ำท่อม สูบบุหรี่จัดขึ้น นอนตี3-4 ตื่นบ่าย4-5โมงเย็น ขาดความรับผิดชอบแม้แต่ทำความสะอาดห้อง เก็บกวาดเช็ดถู ภาระเงินทองเวลาที่พ่อแม่เดือดร้อน) \r\nตลอดเวลา2 ปีมานี้ เรารับผิดชอบทุกอย่าง ภาระตกอยู่ที่เราหมด ตั้งแต่ค่ากินค่าเช่าห้องค่าผ่อนรถ สารพัดจนไปถึงเวลาที่บ้านเค้าเดือดร้อน\r\nพอเราเหนื่อยเราเครียด ก็ทะเลาะกัน เถียงกัน ด่าว่ากัน จนหมดความเกรงใจกัน หมดความให้เกียรติกัน เลยอยากขอความกรุณาอาจารย์ ช่วยแนะนำแก้ไขให้ทีคะ\r\nขอบพระคุณคะ ', 'นัชชา', 2521, '2018-03-20 11:07:06'),
