(406, 'ชีวิตเปลี่ยนจิงๆคะ', 'เปนคนไม่เคยเชื่อเรื่องพวกนี้เลย วันนึงเพื่อนเรียกให้มาดูเบอร์(เบอเก่า) พออ่านเท่านั้นแหละ หน้าชามาก นี่มันตัวเราเลยนี่หว่า(ไม่เคยเปลี่ยนเบอร์เลยร่วม5ปี)คือเลว ร้าย มาก ตรงมาก เลยลองดูเบอร์ที่ชอบในนี้ แล้วเปลี่ยน ตอนนี้เปลี่ยนมาจะ2ปีแล้วคะ รู้าึกชีวิตค่อยๆเปลี่ยน ความรู้สึก ความคิด ทัศนคติเปลี่ยน ต้องขอบคุณอาจารย์ด้วย อาจารย์น่ารักมากๆ ยังไม่ทันโอนตังให้เลย ส่งเบอมาให้แล้ว ขอบคุณมากนะคะ ', 'Innlove', 2016, '2014-08-16 02:45:27'),
