(456, 'อยากได้เบอร์ดี ที่เราระบุความหมายเองได้ไหมคะ', 'คือว่าเบอร์ดีๆ ที่เข้าไปอ่านความหมายข้างในแล้ว มีบางอันไม่ชอบทั้งหมด สามารถเลือกเอาความหมายที่เราชอบออกมา เพื่อจะหาเบอร์ดีๆ สามารถทำได้หรือเปล่าคะ', 'ปวีณ์พัชญ์', 2168, '2014-10-17 14:34:32'),
