(458, 'พึ่งรู้ว่าเบอร์เก่าความหมายแย่มากๆ', 'ตอนนี้ใช้เบอร์ 0814837055 ความหมายไม่ดีมากเลยค่ะ\r\nอยากเปลี่ยนเบอร์ให้\r\n-มีแต่คนรัก คนจริงใจ (ถึงมีคนนินทา แต่มีคนเข้าใจ)\r\n-มีเงินเก็บเยอะๆ ทำมาค้าขายดี\r\n-เงินไม่ขาดมือ', 'คนดวงซวย', 1600, '2014-10-20 17:52:49'),
