(463, 'รบกวนช่วยเลือกเบอร์ด้วยครับ', 'ตอนนี้เป็นพนักงานบริษัททำเว็บทำกราฟฟิค กับขายของออนไลน์งานแฮนด์เมด\r\nเบอร์ไหนช่วยเสริม งาน เงิน ความรัก บ้าง\r\nแล้วใช้ 2 เบอร์เสริมกันได้ไหมครับ\r\n\r\n093-9594563\r\n090-9499564\r\n093-6915632\r\n090-5646442\r\n\r\nขอบคุณครับ', 'tee', 1684, '2014-10-31 14:35:29'),
