(492, 'สอบถามเบอร์โทรค่ะ', 'ได้ซื้อเบอร์0915466298 จากเวปอาจารย์ไปค่ะ มันเน้นเรื่องใดมากที่สุดค่ะ ใช้เบอร์0896890281ดูความหมายไม่ดีเลยทิ้งไป จะมีผลต่อการเปลี่ยนแปลงชีวิตเมื่อไรค่ะ', 'Ploylygirl', 2015, '2014-12-12 05:29:27'),
(495, 'สอบถามเบอร์ครับ', '0614491964 0614969641\r\n2 เบอร์นี้อันไหนช่วนเรื่องความรักกับการเรียนดีกว่าครับ\r\n', 'tan', 1662, '2014-12-17 23:47:08'),
(496, 'มีเบอร์ในใจ เลือกเบอร์ไหนดีคะ', 'หนูเป็นนักศึกษาค่ะ ตอนนี้ศึกษาเกี่ยวการวัดสายตาค่ะ อยากได้เบอร์โทรที่ใช้ได้นาน เมื่อเรียนจบสามารถหางานทำได้ทั้งราชการ เช่น งานในโรงพยาบาล และงานค้าขาย เพราะที่บ้านมีกิจการร้านแว่นตาด้วย \r\n\r\nตอนนี้มี2เบอร์ เลือกไม่ได้ค่ะ ระหว่าง 0962464156 กับ 0941954465', 'เฟย์', 2057, '2014-12-20 00:32:37'),
(499, 'รบกวนสอบถามเรื่องเบอร์ค่ะ', 'อจ.คะ สอบถามเบอร์  090-5563656 เบอร์นี้เด่นเรื่องใดคะ  สามารถใช้เบอร์นี้ตลอดไปได้มั้ยคะ', 'มุก', 1601, '2014-12-20 21:28:50'),
(500, 'รบกวรอาจารย์ช่วยตรวจเบอร์ให้หน่อยนะคะ', '0989265415 มีเลข 89 ดุไปไหมค่ะ\r\nและ 92 อ่อนไหวไหมค่ะ\r\nใช้กับงานราชการเกี่ยวกับการสอนค่ะ', 'panda', 1709, '2014-12-20 22:19:18'),
(505, 'รบกวนสอบถามเบอร์ครับ', 'เบอร์ 0942642451\r\nเบอร์นี้เรื่องความรักดีไหมครับ', 'tana', 1770, '2014-12-28 09:48:26'),
(507, 'ปรึกษาเรื่องเบอร์โทรศัพท์ครับ', 'ตอนนี้ผมใช้เบอร์ 08999562656 กับหมายเลข 0895515565 อาชีพผมทำงานในโรงพยาบาล รบกวนถามอาจารย์ว่าถ้าจะใช้เบอร์เดียวเบอร์ไหนเหมาะสมที่สุดครับ หรือถ้าใช้ด้วยกันทั้ง 2 เบอร์ ได้มั้ยครับ ขอบคุณมากครับ (สิ่งที่เน้นคือด้านการงาน การเงิน ความรัก) หรือถ้าอาจารย์มีเลขแนะนำ แนะนำได้เลยนะครับ ขอบคุณมากครับ', 'ชัชรินทร์', 1963, '2014-12-30 08:47:52'),
(508, 'เราควรเลือกเบอร์โทรให้สอดคล้องกับดาวในดวงชะตาหรือเปล่าคะ', 'สวัสดีปีใหม่ค่ะ ขออวยพรให้ท่านอาจารย์และครอบครัวจงพบแต่ความสุขความเจริญตลอดทั้งปีและตลอดไปนะคะ\r\n\r\nขอเรียนถามท่านอาจารย์ดังนี้นะคะ\r\n\r\n1.การเลือก เบอร์โทร เราต้องดูคู่กับดาวในดวงเกิดด้วยหรือใหม่คะ \r\n\r\n\r\nดิฉันเป็นคนที่ดาวบาปพระเคราะห์ ทั้ง 1 3 7 ให้คุณทั้งนั้นเลยค่ะ (อุจจ์) แต่ดิฉันมี 2 กุมลัคน์ ซึ่งเป็นเจ้าเรือนอริมากุมชะตาอยู่ด้วย ควรใช้เบอร์ที่มี 2 หรือควรเลี่ยงดีตะ  (อริ 2 มรณะ 4 วินาศ 7 ทั้งนี้ เจ้าเรือนมรณะเป็นประค่ะ เข้ากฏ ลบ ลบ เป็นบวกหรือเปล่าคะ)\r\n\r\n\r\nรบกวนอาจารย์ วิจารณ์ดวงจากเลขโทรเหล่านี้ด้วยค่ะ ว่าเหมาะสมใช้ด้านไหน\r\n\r\nXx1 959 3899 (ดิฉันมีจันทร์ซึ่งเป็นอริมากุมลักขณา โดยส่วนตัว มีความโลเล วกไปวนมา แต่มีราหูเป็นเจ้าเรือนประจำตนุลัคน์ เลยมีความลมเพลมพัด มากกว่ากล้าหาญ เด็ดเดี่ยวแบบอังคาร จึงหวังว่าจะได้ความกล้าจาก 38 มาช่วยบ้าง แต่ก็เกรงว่าจะบ้าระห่ำเกินไป สรุปเบอร์นี้ ควรใช้หรือไม่ ให้คุณกับดวงชะตาดีหรือไม่ดีคะ)\r\n\r\nขอบพระคุณอาจารย์ล่วงหน้าค่ะ\r\n\r\n\r\nปล ดิฉัน มี 5 0 ร่วมกัน และ 9 เล็ง ด้วยค่ะ ดิฉันศึกษาโหราศาสตร์และเลขศาสตร์ จะพอไหวหรือเปล่าคะ', 'เด็กน้อยฝึกหัด', 3597, '2015-01-02 00:27:28'),
(510, 'รบกวนอ.ช่วยดูเบอร์นี้หน่อยค่ะ', 'หนูเป็นคนที่พูดมาก พูดไม่หยุด พูดจนลิงหลับ บางครั้งก็กลายเป็นพูดไปเรื่อย ไม่รู้จักกาละเทศะ ถ้าหนูใช้เบอร์0941954465 มันจะทำให้เรื่องการพูดหนูดีขึ้นไหมคะ (หนูกังวลค่ะ บางคนบอกว่าเลข44จะทำให้หนูพูดมากกว่าเดิม) \r\n\r\nปล.หนูจะใช้เบอร์นี้เพื่อทำงานเกี่ยวกับราชการและงานค้าขายในเบอร์เดียวกันค่ะ\r\n\r\n', 'เฟย์', 1792, '2015-01-07 22:03:01'),
(512, 'สอบถามเรื่องเบอร์ค่ะ', 'ซื้อเบอร์. 0924656615 จากเว็บอาจารย์ไปใช้ตั้งแต่ เมษา 57. ถึงตอนนี้แล้ว ทำไมความรักไม่รุ่งเลยคะ. ', 'Chattybeau', 1719, '2015-01-11 21:27:28'),
(513, 'ช่วยเช็คเบอร์ให้หน่อยค่ะ', 'ไม่ทราบว่าเบอร์นี้จะส่งผลด้านความรัก ความก้าวหน้า และความร่ำรวยมากน้อยแค่ไหนคะอาจารย์\r\nxx92299656\r\nขอบคุณมากค่ะ', 'MS', 1894, '2015-01-11 22:09:36'),
