(533, 'รบกวนดูเบอร์หน่อยคร้าา', 'เบอร์061 6424295 เบอร์นี้ไม่ดียังไงบ้างคะ', 'มายด์มิ้น', 1780, '2015-02-13 02:54:58'),
(540, 'รบกวนดูเบอร์ให้หน่อยค่ะ', '0940564914\r\nมีโชคเรื่องงานกับความรักมั้ยคะ\r\nกำลังจะสมัครงานใหม่และอยากให้ญาตของแฟนเอ็นดูเราอ่ะค่ะ แล้วเบอร์นี้เหมาะจะใช้ยาวๆมั้ยคะ ขอบคุณค่ะ', 'watchareeporn', 1758, '2015-03-02 19:03:31'),
(543, 'สอบถามเบอร์โทรปัจจุบัน ', 'เบอร์ 0815856449  ทำงานด้านบัญชีการเงิน ผู้บริหารระดับสูง และทำค้าขายส่วนตัวด้วยครับ  อยากสอบถามว่าเบอร์ดังกล่าว เหมาะ หรือ ไม่เหมาะสมกับลักษณะงาน ครับ', 'พี', 1640, '2015-03-08 19:16:55'),
(544, 'เบอร์นี้เหมาะกับผญมั้ยค่ะ', '0939892499 มีผลเสียมั้ยคะ', 'name', 1970, '2015-03-09 11:49:44'),
(550, 'ขอคำแนะนำในการเลือกเบอร์ค่ะ', 'ตาลมีจองเบอร์ไว้คือ 092-6596422 กับ 098-9516905 ขอคำแนะนำค่ะว่า เบอร์ไหนเหมาะสมกับตาลที่สุดค่ะ ขอบคุณมากค่ะ', 'ตาล', 1689, '2015-03-22 13:51:52'),
(558, 'รบกวน ถามเรื่องการเลือกเบอร์ด้วยครับ', ' xx1424 4951  xx1591 4241\r\nงาน เงิน ความรัก \r\nดีด้อยต่างกันยังไง\r\nเลือกเบอร์ไหนดีครับ\r\nขอบคุณครับ', 'แสง', 1669, '2015-03-28 08:28:19'),
(559, 'เบอร์นี้ งาน เงิน ความรัก ผ่านไหมครับ', 'xx 2454 9442', 'แสง', 1915, '2015-03-28 09:55:32');
INSERT INTO `webboard` (`webboard_id`, `webboard_title`, `webboard_content`, `webboard_post`, `webboard_read`, `webboard_date`) VALUES
(562, 'ขอคำปรึกษาเบอร์ 2 เบอร์นี้หน่อยนะคะอาจารย์', 'หนูได้เบอร์มาสองเบอร์คะคือ\r\nxx66566264\r\nxx46696264\r\nอยากจะถามว่า\r\n1 ในสองเบอร์นี้เบอร์ไหนมีตัวเลขการเงินที่ดี ถ้าเทียบกัน\r\n2 ในสองเบอร์นี้เบอร์ไหนมีเสน่ดึงดูดที่ดี ถ้าเทียบกัน \r\n\r\nรบกวนเวลาอาจารย์หน่อยนะคร้า หนูจะเอาไว้ใช้เองเบอร์นึง อีกเบอร์ให้แม่ใช้คะอาจารย์ ขอบคุณล่วงหน้าคะอาจารย์ ^_^\r\n', 'อรจิรา', 1840, '2015-04-10 09:27:16'),
(566, 'รบกวนถามเรื่อง การงานการเงินครับ', '0x41536151 การงาน การเงิน ได้มั้ยครับ ขอบพระคุณอย่างสูงครับ', 'ป่อง', 1653, '2015-04-22 16:48:24'),
(567, 'อยากทราบว่าเบอร์ดีเรืองความรักการงานไหมครับ', '0864564251 เบอร์นี้ไม่ทราบว่าใช้ดีไหมครับ ', 'กร', 1863, '2015-04-24 18:51:46'),
(569, 'ช่วยดูเบอร์นี้ครับ เรื่องการงาน การเงิน', '086-6245450 (ผู้ชาย) ใช้มา 10 ปีแล้ว\r\nทำงานเกี่ยวกับหนังสือ และธุรกิจห้องเช่า\r\n ปัจจุบันสมรสแล้ว ลูก 2 คน\r\nเกิด 27 มีนา 2528 ฉลูครับ', 'เก่ง', 1734, '2015-04-30 10:35:24'),
(571, 'รบกวนถามเรื่องการเงิน กับ การงานครับ ', '0931689156 ใช้ได้ไม่ครับ  หรือว่าควรเปลี่ยน.', 'ปลา', 1838, '2015-05-02 17:37:38'),
(572, 'สอบถามเรื่องเบอร์ที่ใช้อยู่ว่าดีไหมครับ', 'ใช้เบอร์นี้ครับ 0818993397\r\nแล้วเบอร์นี้ไม่ค่อยได้ใช้ 0995644779 ครับ', 'noon', 1671, '2015-05-07 16:13:20'),
(576, 'สอบถามเบอร์ที่จอง', 'อาจารย์ครับ ผมจองเบอร์ 061-4616263 หาเบอร์ไม่เจอแล้ว มีคนเอาไปแล้วหรือว่าไงครับ เลยยังไม่กล้าโอนเงิน', 'สุกิจ', 1630, '2015-05-19 19:07:16'),
(579, 'อาจารย์ค่ะรบกวนหน่อยนะค่ะ', 'หนูมีเบอร์อยู่สามเบอร์แต่อยากได้เบอร์หลักค่ะจะใช้เบอร์ไหนดีคะเปิดกิจการเลี้ยงเด็กค่ะ. \r\n0615095461\r\n0997966642\r\n0939893619', 'อิ่มอุ่น', 1803, '2015-05-28 10:32:18'),
(584, 'ขอความกรุณาอาจารย์ช่วยดูให้ด้วยว่าดีไหมค่ะ', '0x9 416 6654 และ 0x9 416 9566           ลังเลในการเลือกมากค่ะ ปัจจุบันใช้ 0x4 924 2916    อยากค้าขายเบอร์ไหนเหมาะค่ะ ', 'nue', 1689, '2015-06-07 19:33:04'),
(592, 'จะเลือกใช้เบอร์ไหนดี', 'รบกวนสอบถามค่ะ จะเลือกใช้เบอร์ไหนดี ระหว่าง 093-9146624 และ 062-4639356 เพศหญิง อายุ 35 ปี ทำงานเลขานุการค่ะ ขอบคุณล่วงหน้าสำหรับความกรุณาค่ะ', 'Nok', 1656, '2015-06-28 00:19:48'),
(602, 'รบกวนช่วยเลือกเบอร์ให้หน่อยค่ะอาจารย์', 'ปัจจุบันใช้เบอร์0856666974 จะใช้เบอร์เพิ่มอีกเบอร์ค่ะระหว่าง0624479665 กับ0619946422\r\n', 'ธนภร', 1712, '2015-07-11 22:10:57'),
(608, 'รบกวนอาจารย์ช่วยดูเบอร์ให้ผมด้วยครับ', '0x42596563\r\n0x39264496\r\n\r\nผมทำงานอิสระ พวกกราฟฟิค ว่าจะจับงานนายหน้าที่ดิน หรือพวกซื้อมาขายไป ผมทำได้ไหม \r\nตอนนี้ชีวิตติดขัด ตั้งตัวไม่ได้สีกที', 'AA', 1617, '2015-07-27 01:01:27'),
(611, 'รบกวนดูเบอร์ให้หน่อยครับ กำลังจะเปลี่ยนเบอร์ใหม่', '095-2466995 เบอร์เก่าที่ใช้คือ 095-9477982\r\nเกิด 17 มีค. 2535 \r\nต้องการเฮงๆรวยๆ โชคลาภครับ', 'สตางค์', 1881, '2015-07-28 16:48:29'),
(610, 'รบกวนอาจารย์ดูเบอร์ให้หน่อยคะ', 'เบอร์ทีใช้อยู่ควรเปลี่ยนไหมคะ \r\n\r\nดีหรือไม่ดีคะ   (0610979989)', 'ชมพู่', 1512, '2015-07-27 23:42:25'),
(612, 'รบกวนช่วยดูเบอร์ให้หน่อยค่ะ', 'เกิดวันจันทร์ เดือนธันวาคม ปีมะเส็งค่ะ\r\nเบอร์ 094-6419942\r\n\r\nเบอร์ดีไหมคะ ส่งผลเรื่องความรักอย่างไรบ้าง\r\n\r\nขอบคุณค่ะ', 'มะม่วง', 1900, '2015-07-30 21:59:20'),
(616, 'เบอร์นี้ไหนเหมาะกว่ากันครับ', 'ปัจจุบันใช้เบอร์ xx91596951 มาได้ 6 เดือนครับ เลือกมาเพราะถูกใจ แต่บางคนทักว่าไม่ดีในเรื่องความรัก เลยหามาอีกเบอร์ xx26519615 อยากทราบว่าเทียบกันแล้วเบอร์ไหนดีกว่ากันครับ ทำงานสายนักวิเคราะห์หลักทรัพย์/การลงทุน/ที่ปรึกษาทางการเงิน ยังโสดอยู่ครับ ขอบคุณครับ', 'ped', 1708, '2015-08-02 22:39:20'),
(627, 'เบอร์นี้ทำนายได้101.4% ดีหรือไม่ไดียังไงคับ', 'เบอร์ 0X51698890 พอดีซื้อมาเป็นเบอร์รองเพื่อฉุกเฉิน ลองมาตรวจดูปรากฏว่าเป็นแบบนี้ มันดีมั้ยคับที่เกิน100%มา หรือเว็ปคำนวนผิด', '3gp', 1863, '2015-08-16 21:47:44'),
(629, 'รบกวนอาจารย์ช่วยดูเบอร์ให้หน่อยคะ', 'รบกวนอาจารย์ช่วยดูเบอร์ให้หน่อยค่ะ \r\nปัจจุบันใช้ 2 เบอร์ คือ  0X2-639-1651 \r\nและเบอร์ 0X4-263-5914 \r\nทำอาชีพพนักงานรัฐวิสาหกิจ ตำแหน่งนักบริหารผลประโยชน์และปล่อยเช่า/ขาย คอนโดด้วยค่ะ\r\nไม่ทราบว่าเบอร์ไหนควรใช้เป็นเบอร์ งาน+ธุรกิจ และเบอร์ไหนควรใช้เป็นเบอร์ส่วนตัวค่ะ\r\nขอบพระคุณค่ะ', 'wooya', 1996, '2015-08-21 14:08:04'),
(634, 'รบกวนดูเบอร์ให้หน่อยครับ', 'ตอนนี้ผมใช้เบอร์ 0965916463 เป็นเบอร์หลัก และ เบอร์ 0619950942 เป็นเบอร์รอง ผมทำงานเกี่ยวกับการจัดอีเว้นท์ ประชาสัมพันธ์ครับ ขอขอบคุณล่วงหน้าครับ', 'พุทธิวัฒน์', 1816, '2015-08-27 21:52:02'),
(635, 'รบกวนดูเบอร์ให้หน่อยนะค่ะ', 'ช่วยรบกวนดูเบอร์ให้หน่อยนะค่ะ พอดีทำงานเกี่ยวกับการติดต่อประสานงานเซล และค้าขาย  และดูเรื่องความรัก ให้หน่อยนะค่ะ 080-536-8253 , 099-251-5044,เบอร์ออฟฟิต 061-419-9266 ค่ะ', 'อร', 1707, '2015-08-28 18:11:18'),
(644, 'เบอร์ปัจจุบันเปลี่ยนดีไหมครับ ขอบคุณครับ', 'Xx-1994-9988 ผลรวม63 ควรใช้ต่อหรือดีครับ หรือหาเบอร์อื่นมาเวริมแก้ดีครับ ขอบคุณครับ', 'Duncan98', 1919, '2015-09-10 18:34:34'),
(647, 'รบกวนดูให้ทีครับ', 'ตอนนี้ใช้xx-82146715 อยู่ครับ\r\nกำลังจะเปลี่ยนเป็นxx-44644697 \r\nตอนนี้ทำอาชีพพ่อครัวอยู่ที่โรงแรมครับแต่อนาคตจะทำธุรกิจส่วนตัวครับ', 'กันต์', 1837, '2015-09-12 01:16:40'),
(648, 'รบกวนสอบคามเรื่องเบอร์ครับ', 'ผมทำอาชีพรับราชการเบอร์ที่ใช้อยู่0616269953กับอีกเบอร์0616362651 เบอร์ที่2ใช้ส่สนตัวครับเบอร์แรกใช้ติดต่อเรื่องงานครับ เบอร์เสียไหมครับ', 'ปัณ', 1890, '2015-09-12 20:01:35'),
(651, 'รบกวนอาจารย์ช่วยดู 2 เบอร์นี้ให้หน่อยนะคะ ขอบคุณค่ะ', '\r\nคือได้เบอร์ 095-2465956 กับ 093-9946542 มาค่ะ\r\nอยากเรียนถามว่าเบอร์ไหนดีกว่ากันค่ะ พอดีจะเลือกใช้แค่เบอร์เดียวค่ะ\r\nขอบคุณอาจารย์มากนะคะ', 'สุพิชชาค่ะ', 1773, '2015-09-18 16:30:49'),
(652, 'รบกวนแนะนำให้ด้วยครับ', 'ปัจจุบันผมมีหมายเลขที่ใช้อยู่ 2 หมายเลข 0x14192942 และ 0x61426978 ใช้อยู่ครับ ล่าสุดคือได้หมายเลข 0x26478251 มาแต่ยังไม่ได้เปิดใช้ อยากรบกวนช่วยแนะนำในการเลือกเอาหมายเลขที่จะใช้เพียง 1 หมายเลข ครับ ** หากจำเป็นต้องใช้ 2 หมายเลข คู่กัน เพื่อส่งเสริม อยากให้แนะนำด้วยครับ \r\nปล.ผมทำงานด้านเซอร์วิสอพาร์ทเม้นท์สำหรับชาวต่างชาติ และมีคอนโดให้เช่า \r\nขอบคุณครับ ', 'หน่อย', 1771, '2015-09-19 11:16:37'),
(656, 'สอบถามเบอร์ปัจจุบันค่ะ', '099-8949615 บริษัทเอกชน หัวหน้างานบัญชี แต่งงานแล้ว ยังไม่มีบุตร สอบถามเรื่อง การงาน การเงิน ผู้ใหญ่เมตตา คนรัก เกิดวันอาทิตย์ ใช้มา6 เดือนแล้ว ต้องเปลี่ยนไหมคะ...ขอบคุณมากๆนะคะ', 'โบว์', 1634, '2015-09-22 17:14:12'),
(659, 'รบกวนอาจารย์สอบถามเบอร์หน่อยค่ะ', 'ตอนนี้มีเบอร์ 0xx-459-5146 กับ 0xx-9596642\r\nโดยรวมควรจะใช้เบอร์ไหนดีคะ ทั้งสองเบอร์แตกต่างกันอย่างไร\r\nรบกวนอาจารย์ดูให้หน่อยนะคะ\r\nขอบพระคุณอาจารย์ล่วงหน้าค่ะ', 'แม้นวาดค่ะ', 1759, '2015-09-28 17:11:48'),
(661, 'สวัสดีครับอาจารย์ รบกวนสอบถามเกี่ยวกับเบอร์ครับ', 'สวัสดีครับ\r\nผมกำลังมีปัญหาหลายเรื่องครับ ตอนนี้เรื่องความรักค่อนข้างหนัก กับแฟนที่คบมา 6 ปีกำลังจะขึ้นปีที่ 7 สุดท้ายก็มาเจอปัญหาแยกทางครับ ซึ่งตอนนี้ก็พยายามจะทำทุกอย่างให้กลับมาเหมือนเดิม มาเจอเรื่องเบอร์ตัวเองมีเลข 72, 27 ซึ่งเป็นเลขที่ไม่ดีในเรื่องคู่ครอง ซึ่งเบอร์ของแฟนเก่าผมก็มีเลขนี้เช่นกัน เลยคิดอยากจะเปลี่ยนเบอร์ครับ \r\nสิ่งที่จะเน้นก็หลายๆเรื่องครับ \r\n\r\nเรื่องความรัก, เรื่องงาน, เรื่องการเงิน \r\nจากตามดวงผม เท่าที่หาข้อมูลจากหลายๆแหล่ง\r\nผมได้ความมาว่า\r\nเกิด 27 มกราคม 2529 เวลา 7.00 \r\nเบอร์ที่ใช้ เบอร์ปัจจุบัน 0819997224 ใช้มา 2-4 ปี, เบอร์เก่าที่เคยใช้ 0840444570\r\nอาชีพตัวแทนประกันชีวิต \r\nต้องการเน้น 3 เรื่อง \r\nความรัก เน้นมากที่สุด, การเงิน รองลงมา, และการงาน น้อยที่สุด \r\n\r\nเค้าแนะนำให้หาเบอร์ที่มีตัวเลข 5 3 6 9 เรียงตามลำดับดีที่สุดไปน้อยที่สุด \r\nโดยให้หลีกเลี่ยง 1, 7 \r\n\r\nส่วนเลขอื่นถือเป็นเลขดีปานกลางมีหรือไม่มีก็ได้\r\n\r\nให้หาเบอร์ที่มีกลุ่มตัวเลข 536 หรือ 635 ถ้าไม่มีไม่เป็นไร \r\n\r\nผมได้ไปคัดเบอร์มาบางส่วนครับ\r\nโดยดูจาก\r\nผลรวม, เลขคู่มงคล, คะแนนคำทำนาย และน้ำหนักคำทำนาย\r\n\r\nเลยอยากรบกวนช่วยดูให้ผมทีครับ ว่าเบอร์ไหนดีที่สุด ไล่ไปเรื่อยๆจนแย่ที่สุดเลยนะครับ \r\n\r\n096-696-5366 \r\n099-535-6355 \r\n083-965-9996 \r\n099-536-5553 \r\n095-639-5553 \r\n099-563-5553 \r\n096-594-5553 \r\n099-649-5369 \r\n\r\nจนตอนนี้คัดมาเหลือ 2 เบอร์สุดท้าย\r\n\r\niPhone\r\n 099-535-6355\r\n\r\niPad\r\n096-969-5366\r\n\r\nไม่ทราบว่าเหมาะสมดีแล้วหรือยังครับ\r\n\r\nขอบคุณมากครับ\r\n\r\n\r\n', 'Nicholas', 4587, '2015-09-30 18:19:42'),
